static const uint16_t FREQ_INDEX_COUNT = 102;

bool findUSAStation(uint16_t freq, uint16_t pi, char* callOut, char* stateOut) {
    for (uint16_t i = 0; i < FREQ_INDEX_COUNT; i++) {
        FreqLookup idx;
        memcpy_P(&idx, &freq_index[i], sizeof(FreqLookup));
        if (idx.freq == freq) {
            int lo = 0, hi = idx.count - 1;
            while (lo <= hi) {
                int mid = (lo + hi) / 2;
                USAStation st;
                memcpy_P(&st, &idx.stations[mid], sizeof(USAStation));
                if (st.pi == pi) {
                    strcpy(callOut, st.call);
                    strcpy(stateOut, st.state);
                    return true;
                } else if (st.pi < pi) {
                    lo = mid + 1;
                } else {
                    hi = mid - 1;
                }
            }
            return false;
        }
    }
    return false;
}
